  [],\n\t\"revision_timestamp\": \"2016-07-27T22:38:05.411875\",\n\t\"name\": \"vascular-flora-of-fort-mcclellan-calhoun-county-alabama\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fort McClellan is a military base located
  in the mountains of northeast Alabama (see Fig.1). Municipalities and communities
  surrounding Main Post include the City of Anniston on the south and west, the City
  of Weaver on the west and northwest, and several communities to the east including
  White Plains, Pleasant Ridge, Antioch, and Choccolocco (now partially incorporated
  into the City of Oxford). Pelham Range, a training area disjunct from the Main Post,
  is bordered by US 431 and Leatherwood Road along the east, Anniston Anny Depot on
  the south, and by rural neighborhoods on the west and north. The reservation has
  been in use since the beginnings of World War II when nearly the entire cantonment
  served as bivouac areas for US Army troops and their training. The primary purpose
  of this study is to inventory the vascular plant life of Main Post and Pelham Range,
  to document element occurrences of environmentally sensitive species, and to provide
  insight into the basic distribution of the native plants relative to community structure.
  Pursuant to the latter objective, certain areas on Main Post and Pelham Range have
  evinced themselves to be important to the maintenance of biodiversity on the reservations.
  Much time has been spent within these areas to properly characterize the plant assemblages
  in and to ascertain the distribution of these community types. The results of the
  1996 botanical survey are contained in this document.\",\n\t\"license_title\": \"License
